function Square({ dark }) {
    let c = "chessSquare";
    c = dark ? c + ' dark' : c;
    return <div className={c}></div>
}

function Row({ val }) {
    let squares = [];

    for (let i = 0; i < 8; i++) {
        let dark = i % 2 == 0 ? true : false;
        squares.push(<Square dark={dark}></Square>)
    }

    return squares;
}

function Board() {
    let rows = [];

    for (let i = 0; i < 8; i++) {
        rows.push(<Row></Row>)
    }

    return rows;
}

export default function Chess() {
    return (<>
        <div className="container">
            <div className="chessGrid">
                <Board></Board>
            </div>
        </div>
    </>)
}
